import React from 'react';
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import Collapse from "react-bootstrap/Collapse";
import MySelector from "./MySelector";
import MyCheckPoint from './MyCheckPoint';

const MoreHideOptions = ({onClickShowMore, isShowMore, mySelectorOptions,isCheckClick, onCheckPoint, onClickSelector, isSelectorClick}) => (
    <div>
        <Row>
            <Col md={5}>
                <small style={{color: 'white'}}>For 1-2 passengers with 1-2 bags</small>
            </Col> <Col md={{span: 3, offset: 3}} style={{color: 'red'}}
                        className='d-flex justify-content-end'>
            <div
                style={{cursor: 'pointer'}}
                onClick={onClickShowMore}
                aria-controls="example-collapse"

            >
                {!isShowMore ? <small>more options</small> : <small>hide options</small>}
            </div>
        </Col>
        </Row>
        <Collapse in={isShowMore}>
            <div id="example-collapse">
                <Row>
                    {mySelectorOptions.map((val, key) => {
                        return <MySelector key={key} img={val.img} item={val.item}/>
                    })}
                </Row>
                <MyCheckPoint isCheckClick={isCheckClick} onCheckPoint={onCheckPoint} onClickSelector={onClickSelector} isSelectorClick={isSelectorClick}/>

            </div>
        </Collapse>
    </div>
);
export default MoreHideOptions;
